                    transition: 0.3s;
                }
                span{
                    margin-left: 40px;
                }
                .btn-up{
                    margin-left: auto;
                }
                .btn-down{
                    margin-left: auto;
                }
            }
            .service__acord-panel{
                display: none;
                padding: 10px 20px 10px 0px;                
                border: 1px solid #C6CBCD;
                textarea{
                    width: 100%;
                    padding: 20px;
                    resize: none;
                    font-style: normal;
                    font-weight: 400;
                    font-size: 18px;
                    line-height: 21px;
                    white-space: normal;
                    background-color: #FFFFFF;
                    border: none;
                    text-align: justify;
                    padding-right: 40px;
                    height: 163px;
                    &::-webkit-scrollbar {
                        width: 7px;
                        background-color: #F5F5F5;
                    }                     
                    &::-webkit-scrollbar-track {
                        -webkit-box-shadow: inset 0 0 6px rgba(0,0,0,0.3); 
                        -webkit-border-radius: 7px;
                        border-radius: 7px;
                    }
                    &::-webkit-scrollbar-thumb {
                        background: #95E1D3; 
                    }
                }
            }
        }

    }
}

